import React, { useEffect, useState } from "react";

function PaginaPrinc() {
  const [dataFromServer, setDataFromServer] = useState(null);

  useEffect(() => {
    fetch("http://217.160.0.78:3000") // Realiza la solicitud al servidor
      .then(response => response.text())
      .then(data => {
        setDataFromServer(data); // Actualiza el estado con los datos del servidor
      })
      .catch(error => {
        console.error("Error al obtener los datos del servidor:", error);
      });
  }, []);

  return (
    <div>
      {dataFromServer ? (
        <p>Respuesta del servidor: {dataFromServer}</p>
      ) : (
        <p>Cargando...</p>
      )}
    </div>
  );
}

export default PaginaPrinc;
